        }
        if (isset($this->changeRequests)) {
            $json['changeRequests'] = $this->changeRequests;
        }
        if (isset($this->paymentUpdates)) {
            $json['paymentUpdates'] = $this->paymentUpdates;
        }
        if (isset($this->payouts)) {
            $json['payouts']        = $this->payouts;
        }

        return (!$asArrayWhenEmpty && empty($json)) ? new stdClass() : $json;
    }
}
